                    "A plethora of courier services are available in Bangladesh which are more expensive, less effective and takes\nages to deliver the product. Besides, in the ongoing COVID-19 pandemic situation, its onerous to move from one place\nto another, and if a person wants to send a product, he/she needs to go to the courier office. Moreover, many people\nneed to move from their house for attending office, meetings, and traveling from one district to another district for\nspecial purposes. In this paperwork, a system is introduced to reduce the cost and time to send a product from one place\nto another place. Basically, an application is developed to meet the people who want to send a product and another one\nwho want to carry the product. For carrying the product one can easily earn money. After scrutinizing the cost of\ncourier services in Bangladesh, an algorithm is introduced to calculate the carrying cost of the product and an algorithm\nis also developed for product security.",
