                  paperAbstract:
                    "Disease diagnosis is the most critical task in the medical diagnosis system. At present, the biggest challenge\nis to predict heart disease very quickly; for that limitation, the number of dying people is increasing day by\nday. If a heart disease is diagnosed quickly, we can reduce the death rate indisputably. Thus, this research\nproduces a manual and web-based automatic prediction system that can confer a conceptual report of clear\nwarning of patient's heart condition. The proposed prediction system predicts heart disease using some health\nparameters. The system uses thirteen health parameters like age, sex, chest pain type, blood pressure, ECG,\netc. Eight algorithms are used separately to diagnose heart disease accurately, namely KNN, XgBoost,\nLogistic Regression (LR), Support Vector Machine (SVM), Ada Boost, Decision tree (DT), Nave Bayes, and\nRandom Forest (RF). Decision Tree and Random Forest provide better performance than others among all\nmethods. This research also established a website to easily check their heart condition from home instantly.\nThe system has used 1026 individual patients' data for training and testing. It achieves higher accuracy in the\ndifferent algorithms such as DT (99%), RF (99%), XgBoost (95%), KNN (89%), SVM (85%), LR (85%),\nAda Boost (83%) and Nave Bayes (82%). The experiment result provides a target value of 0 or 1 that refers\nto the patient's presence or absence of heart disease. ",
