                  paperAbstract:
                    "Many people all around the world suffer from heart disease, which is regarded as a severe illness. In healthcare, especially cardiology, it is crucial to accurately and quickly diagnose cardiac problems. In this research, we proposed an accurate and efficient mobile application-based system for diagnosing cardiac disease based on machine learning approaches. The developed mobile application is voice assistive, which makes the proposed application more user-friendly. Numerous machine learning methods have been examined in this study to predict and diagnose cardiovascular disease (CVD). A detailed comparative study was also drawn using eighteen (18) classification algorithms such as Support Vector Machines, Logistic Regression, Linear SVC, K-Nearest Neighbors, Naive Bayes, Stochastic Gradient Descent, Gradient Boosting, Ridge, Bagging, Random Forest, Decision Tree, XGB, LGBM, Extra Trees Perceptron, and Voting Classifier (hard or soft voting). Sixty-eight thousand nine hundred seventy-five (68,975) samples from various patients were used to test the performance of each approach. According to the study, Random Forest and Decision Trees have the best accuracy levels at 99.9%. However, the Support Vector Machine classifier had the lowest performance, barely achieving 60% accuracy.",
