            background: "<p><strong>Assistant Professor</strong></p>",
            biography:
              '<p class="ql-align-justify"><strong>Khandaker Mohammad Mohi Uddin</strong> is an academic researcher and Assistant Professor in the Department of Computer Science and Engineering at <strong>Southeast University (SEU)</strong>. He previously served as an Assistant Professor in the Department of CSE at <strong>Dhaka International University (DIU)</strong>, contributing to the academic community through teaching and research.</p><p class="ql-align-justify">He completed both his <strong>B.Sc.</strong> and <strong>M.Sc. (Research)</strong> in <strong>Computer Science and Engineering</strong> from <strong>Jagannath University</strong>, where he built a strong foundation in computational sciences.</p><p class="ql-align-justify">He has published <strong>more than fifty research articles</strong> in globally reputed journals and conferences, establishing himself as a prolific contributor to the field of computer science. One of his significant contributions is the <strong>establishment of the concept of multivalued DNA computing</strong>, which has opened new avenues in the realm of computational biology and DNA-based computations. His research spans a wide range of topics, including <strong>Machine Learning, Deep Learning, Computer Vision, DNA Computing,</strong> and the <strong>Internet of Things (IoT)</strong>.</p><p class="ql-align-justify">In addition to his research, he has actively contributed to the academic community by serving as a technical committee member and reviewer for several international journals and conferences. His extensive expertise and commitment to advancing the frontiers of computer science have made him a respected figure in his field.</p>',
