                  paperAbstract:
                    "The attendance system is important for school, college, university, office, and factory. In the academic field, attendance is recorded and updated manually in the teachers notebook or any other application. In general, these types of systems waste time for both students and teachers. Also, other Job sectors use fingerprint attendance for arrival and departure, but the time between arrival and departure the employee can go outside anytime that he wants. So, this problem we can overcome using the unique feature of every human being on his face. In this proposed system, facial recognition technology is used to automatically take attendance. Sometimes when many people can come together. This system can able to detect multiple faces at a time. In this system, Face detection is done using DLib and ResNet-34 is used for face recognition. Using two cameras arrival and departure times of an individual are calculated sequentially. 96.03% accuracy observed by the camera-1 to recognize the face and at day time when light is off camera-2 shows the best accuracy 96.62%.",
