                  pageStart: 0,
                  pageEnd: 0,
                  titleOfPublication:
                    "International Journal of Information Engineering and Electronic Business",
                  paperAbstract:
                    "In recent times, various forms of crime have been happening worldwide. The law-and-order department of any country officially records a crime in electronic forms or on paper when the crime is reported by a victim or someone on behalf of the victim. The document that is prepared to file any perceptible committed crimes including dowry, kidnap, murder, rape, theft, and others is called First Information Report(FIR). Nowadays, online FIR also known as e-FIR has been used worldwide. Every day a number of e-FIR are filed, and they are maintained in a centralized database with the aid of third-party trust. Consequently, malicious entities including insiders and outsiders dishonest personnel, and third-party authorities may tamper with e-FIR that questions the transparency and integrity of FIR reports. To address this exposure, in this paper, we propose a blockchain based FIR system to store all kinds of offense-related records to assure security, fidelity and privacy of FIR records. In this proposed system, the blockchain technology that refers to a decentralized and distributed ledger across peer-to-peer networks continually updates the shared ledger and strictly maintains synchronization among all network nodes. Though blockchain technology guarantees tamper-proof of the data, it cannot store a large amount of data due to the replication of ledger among all network nodes. ",
