                  titleOfPublication:
                    "Advances in Artificial Systems for Logistics Engineering III (ICAILE 2023)",
                  paperAbstract:
                    "Different kinds of educational systems have been applied in learning and teaching to maximize the slope of the learning curve of the students. One of those educational systems is the OBE system or Outcome-based education. Outcome-based methods have been adopted in education systems around the world, at multiple levels. In this education system, students and teachers have a clear view of what needs to be accomplished by the end of the course. However, in this education system, as many of the students are trying to get the same outcome, weak students are getting behind to achieve their goals. Hence creating inequity, the proposed work uses the prior student data to apply the Course Outcomes and Program Outcomes (CO-PO) attainment model and recommends the students to focus on their individual weaknesses. So as the students are studying through their courses, their results are recorded. Then the data of those students are used to train the application in our proposed work. Consequently, the application can identify pupils who need to learn their needed topics. As a result of this proposed method, students with different abilities can not only rely on the outcome, but also have to develop their required subjects to thrive in their learning process.",
