                  paperAbstract:
                    "Destruction caused by landslides in Bangladeshs south-east highlights the importance of landslide-hazard mapping and a better understanding of the geomorphic development of landslide hazardous landscapes. Suitable relief, steep terrain gradients, Permiancyclothems and Pennsylvanian that weather into fine-grained soils which have extensive clay, and appropriate precipitation are present in Chittagong, Bandarban, and other hillside regions of Bangladesh. In order to map landslide susceptibility for some of the areas in Rangamati District, Bangladesh, this study compares and evaluates a variety of machine learning models, including Random Forest (RF), Support Vector Machine (SVM), Naive Byes (NB), Random Forest (RF), Logistic Regression (LR), Decision Tree (DT), and the hybrid approaches. This studys combination of logistic regression and random forest demonstrated 91.1% accuracy in landslide prediction. For risk management and disaster planning, this paper provides a useful analysis for selecting the best model for determining landslide susceptibility.",
