                  paperAbstract:
                    "Chronic liver damage is believed to be mostly caused by the Hepatitis C virus (HCV). About 90% of hepatitis C infections progress to chronic hepatitis. Acute HCV infection is a condition that frequently progresses to liver cirrhosis and eventually liver cancer; therefore, understanding this stage of the virus is essential. Molecular and serological testing approaches are often expensive and difficult to perform for diagnosing HCV infection. Machine learning technology can be effectively employed to identify patterns or associations for diagnosing HCV infection. The study utilized machine learning techniques to develop classification models for hepatitis C illness, aiming to anticipate the virus responsible for the infection. Our research integrates various machine learning algorithms, including Random Forest, Cat Boost, Bagging Classifier, SGD Classifier, Gaussian NB, Bernoulli NB, Multinomial NB, Linear Discriminant Analysis, ANN, and MLP. Prior to training the models, preprocessing methods, including normalization, filtering, and SMOTE, were used to improve the datasets attributes. The classification accuracy scores show encouraging results, with ANN scoring 79.63%, MLP scoring 46.29%, Bernoulli NB scoring 79.62%, Cat Boost scoring 98.14%, and Random Forest scoring 99.53%. Among classification methods, random forest demonstrates the highest accuracy in diagnosing HCV infection.",
