            background:
              "<p><strong>Co-ordinator & Assistant Professor</strong></p>",
            biography:
              '<p class="ql-align-justify">I am Mohammad Ashraful Hoque, a faculty member in the Department of Computer Science and Engineering at Southeast University and currently pursuing my Ph.D. at Khulna University of Engineering &amp; Technology (KUET). I hold an M.Sc. in Telecommunication and Computer Network Engineering from London South Bank University, UK, and a B.Sc. in Computer Science from Ahsanullah University of Science and Technology, Bangladesh. My research interests include Blockchain, Elliptic Curve Cryptography, DTN, SDN, and Network Security.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">I have published several notable research papers, including "Autonomous Face Detection System from Real-Time Video Streaming for Ensuring the Intelligence Security System," "SDN-DTN Combined Architecture in Post Disaster Scenario-A New Way to Start," and "An Integration of Power Priority Model in Delay Tolerant Network Routing Protocols for Better Performance." My work has received recognition through citations, reflecting my contributions to network security and innovative solutions in emerging technologies.</p>',
