            createdBy: "zubaida",
            createdTime: "2024-07-02T16:29:14.847",
            biography:
              '<p class="ql-align-justify">Prof. Dr. Shamim Akhter is a distinguished computer scientist and academic currently affiliated with the Department of Computer Science and Engineering at Ahsanullah University of Science and Technology (AUST) as Professor. He earned his undergraduate degree from the American International University of Bangladesh in 2001 and completed his master\'s at the Asian Institute of Technology, Thailand, in 2005. His academic journey culminated in a Ph.D. in information processing from the Tokyo Institute of Technology, Japan, in 2009. Throughout his career, Dr. Akhter has held various roles, including Research Associate, Assistant&amp;/Associate Professor, and leadership positions (head/director of the graduate program, director of IQAC, and the chairperson) at institutions such as the American International University of Bangladesh and Bangladesh Army University of Science and Technology. His international experience includes a JSPS postdoctoral fellowship in Japan and a role as a contact faculty at Thompson Rivers University, Canada.</p><p class="ql-align-justify">As a prolific author, Dr. Akhter has contributed significantly to the field, writing a book and publishing over 60 articles. His research has garnered support from esteemed organizations (Thai Government, the ICT division of Bangladesh, the Global COE Program, @ TokyoTECH, Japan, and JSPS, Japan), and he holds the distinction of being an IEEE senior member actively involved in conferences in various capacities. Dr. Akhter\'s research interests are diverse, covering AI and machine intelligence tools in the CSP domain, data science strategies for business models, IoT and embedded-based solutions for IR4 constraints, evolutionary algorithms focusing on communication and distribution issues, parallel or distributed processing, data distribution, and optimization. His multifaceted contributions underscore a dedication to advancing computer science and technology, emphasizing international collaboration and knowledge dissemination.</p><p class="ql-align-justify"><br></p><p><br></p>',
