                  titleOfPublication:
                    "Southeast University journal of computer Sciences",
                  paperAbstract:
                    "Abstract- The term Digital Bangladesh is a misnomer. Like every other nation in the world, Bangladesh has a strong desire to become a digitized nation to realize the vision 2041. This is a review paper. There are some research works that were carried out in this arena but none really pinpointed the exact issues and ways to deal with those problems. The main purpose of this paper is to identify the actual reasons behind information insecurity as well as to provide some recommendations to minimize the insecurity which may help realize the dream of Digital Bangladesh. The main contribution of the work lies in the form of networking insecurity -the prime impediment to Digital Bangladesh. This study should find some solutions and some recommendations to pinpoint the approach that can be undertaken by the government to realize the vision 2041. Bangladesh holds the utmost prospect to emerge as the next big digitized nation in the south Asian region after India. With the sprout of a technically sound young generation that makes up a large portion of our population,  we are already on our way to building a great digitized nation.  \nIndex Terms - Digital Bangladesh,  Digital Nation, Networking Insecurity, Vision 2041\n",
