                  issnNumber: "2278-0661",
                  titleOfPublication: "IOSR Journal of Computer Engineering",
                  paperAbstract:
                    "Abstract\nThe use of technology in all parts of our lives has greatly increased in recent years, nowadays, people tend to\nsearch for everything online before they make decisions. However, looking for rental houses online is not\ncommon in Bangladesh, it is not because people do not want to, but because there are not many online\nplatforms focusing on residential rentals. For the mentioned reason we developed a house rental finding web\napplication using Laravel, Vue.js, and PHP-ML library. Laravel handles the backend whereas Vue.js manages\nthe frontend, we utilized PHP Machine Learning Librarys Linear Regression and K-Nearest Neighbours (KNN) algorithm to build a machine learning model for the search system. The goal is to make it easier to find\nrental properties. Our system gives personalized suggestions based on user inputs, like location, rental price,\nproperty size, and the number of rooms and bathrooms. Our application aims to make searching for rental\nhouses a better experience and more efficient.\nKeywords: K-Nearest Neighbors (K-NN), Mean Absolute Error (MAE), Root Mean Squared Error (RMSE),\nMachine Learning (ML), JavaScript (JS), Hypertext Preprocessor (PHP)\n",
