                    "Office Automation Enterprise Resource Planning (ERP), Often Misinterpreted Rarely Realized: A Review",
                  volume: "02",
                  issue: "01",
                  edition: "01",
                  series: "01",
                  pageStart: 35,
                  pageEnd: 40,
                  issnNumber: "2789-357",
                  titleOfPublication:
                    "Southeast University Journal of Computer Sciences",
                  paperAbstract:
                    "Abstract- Enterprise Resource Planning (ERP) is complete automation that is often misunderstood and very rarely realized in the world of Virtual Office Automation world. A true ERP is an integrated system that is capable of handling any business activity both big and small including silly calls like finding out if some sweeper was present or absent on a certain date or finding out when a big-time project will be moved to production adding significant value to overall business processes in place. Organizations at times use Executive Information System (EIS), Enterprise Information System (EntIS), Material Requirements Planning (MRP), Manufacturing Resource Planning (MRP II) or in some cases automation to multiple modules automating selected business processes and are referred to as ERP in Bangladesh and possibly some other countries as well. The implementation of ERP requires capital investment. Both misinterpretation and misrepresentation of ERP may cause havoc to investors in terms of costs associated with running an organization. The main objective of the research is to review a good number of published journals in the ERP research arena and shed some light on identifying attributes for true ERP from the unauthentic ones.\n\nIndex Terms - ERP, Virtual Office, EIS, MRP II, Capital Investment\n",
