            background: "<p><strong>Lecturer</strong></p>",
            biography:
              "<p><em>Mohammad S. Rana, i</em>s a Lecturer in the Department of Computer Science at Southeast University, where he has been since 2012. He is also performing his responsibilities as a Moderator of Southeast Computer Club from 2020. Before joining Southeast University, Mr. Rana spent 4+ years at the State University of Bangladesh as a Lecturer and Coordinator under the department of Computer Science and Engineering.</p><p><br></p><p>Mr. Rana has a 7+ years of industry experience working for multiple organizations in the USA as a Programmer and System Analyst. </p><p><br></p><p>Mr. Rana has a Bachelor degree from the University of Central Missouri (UCM), USA. He also worked on his MA (IT) degree from Webster University, Kansas City, MO-USA. After returning to Bangladesh from the USA, Mr. Rana completed his MBA (MIS) from Dhaka University in 2010. Before pursuing is his Bachelor in USA, Mr. Rana completed 60+ credit hours in the department of Computer Science at North South University, Bangladesh which he transferred to UCM which was counted toward his bachelor degree. He is also a proud Notre Damian.    </p>",
