                  issnNumber: "2278-8727",
                  titleOfPublication: "IOSR",
                  paperAbstract:
                    "The scope of the establishment of internetworking security is large enough that requires special attention to details to realize its ultimate wholesome state. As soon as the Data/Information is placed in a medium to transmit over to the next hop, it is at risk of being fabricated by the Man-in-the-middle. Over the years many encryption/decryption algorithms were invented to ensure the integrity and authenticity of the content co compiled at the sender end. Cryptography is a subset of cryptography that only deals with encrypting data that can be passed through secure channels along with keys to ensure security. Where cryptology deals with both encryption and decryption processes. Cryptographic algorithms are primarily categorized into two types - Symmetric and Asymmetric. The main objective of this review paper is to identify how some public (asymmetric) and private (symmetric) keys algorithms fare against each category with respect to attack resistance, efficiency, and other relative measures. Two symmetric algorithms namely Hill Cipher and Data Encryption Standards (DES) were compared against two well known asymmetric key algorithms namely RSA and Diffie-Hellman Key Exchange in this study. The computational and implementation complexities of the algorithms were parts of the discussion as well.\n",
