                  titleOfPaper:
                    "Examining multiplication and division on fuzzy numbers using composite tables",
                  volume: "23",
                  issue: "1",
                  pageStart: 0,
                  pageEnd: 0,
                  paperAbstract:
                    "A fuzzy number is a concept that represents a real number abstractly. It doesnt assign a single value, but instead a range of uncertain values, each with its own weight between 0 and 1. It is essential to comprehend the arithmetic operations of fuzzy numbers in the real number of fuzzy mathematics. One of the fundamental concepts that should not be ignored is the explanation of the interval operation. In this paper, a composition table is constructed to demonstrate the multiplication and division of fuzzy numbers. Fuzzy arithmetic operations are commonly utilized to solve mathematical equations that involve fuzzy numbers. In this paper, we explore the relationship between multiplication and division operations and fuzzy numbers. We also demonstrate that the shape of their membership functions heavily influences the outcome of our calculations when using fuzzy numbers.",
